import React from 'react';
import './CardProduct.css';
import data from '../../mock-data.json';


function CardProduct() {
  return (

    <div className='products'>
      {data.map(obj => {
        return (
          <div className='card' key={obj.id}>
            <img src={obj.image}/>
            <p>{obj.title}</p>
            <p>Price: {obj.price}</p>
          </div>
        );
      })}
    </div>

  );
}

export default CardProduct;
